import styled from "styled-components";

export const HeaderStyle = styled.header`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: space-between;

  padding: 16px;
  padding-left: 280px;
  background-color: #ffffff;
  width: 100%;
`;
